description:
Promotional info for the collected edition - &quot;CARNAGE IS BACK! The fan-favorite villain returns to rock the Marvel Universe, with the Amazing Spider-Man and the Invincible Iron Man first on his hit list. But just why - and how - has Carnage returned, and how many of Marvel's heroes will it take to stop him? Superstar creators Zeb Wells (AMAZING SPIDER-MAN, NEW MUTANTS) and Clayton Crain (GHOST RIDER, X-FORCE) team up for the Spider-Man epic that'll leave jaws on the floor! Literally! &quot;    

Thanks to Empire for the digital copies. Please seed and enjoy. 

